import React from 'react';
import './Card.css';
export default function Card(props){
    return(
        <>
        <div className="s-card" onMouseOver={()=>{
            document.getElementById("c-id").style.color="rgb(10, 181, 10);"
        }}>
           <div className="c-img">
               <img src={props.image} alt="" />
           </div>
           <div className="c-title" id="c-id">
               {props.title}
           </div>
           <div className="c-des">
               {props.des}
           </div>
        </div>
        </>
    )
}
